    var text = '<div class="simple-content-block">  this test  <h1>The Great Gatsby Topic Overview</h1>    <p><strong>"<a href="https://link.gale.com/apps/doc/UASNLZ789712097/LCO?sid=galeopenaccess" data-wa-event-category="SimpleDocLink" data-wa-event-name="Navigate" data-wa-event-label="The Great Gatsby, An Introduction to.">The Great Gatsby, An Introduction to.</a>" <em>Twentieth-Century Literary Criticism </em>Volume 311, <a href="http://www.gale.com" data-wa-event-category="SimpleDocLink" data-wa-event-name="Navigate" data-wa-event-label="Gale">Gale</a>, 2015.</strong></p>        <p>Critics have generally agreed that&nbsp;<em>The Great Gatsby,</em>&nbsp;published in 1925, is the crowning achievement of F. Scott Fitzgerals literary career. It evokes not only the ambiance of the jazz-age search for the American dream of wealth and happiness, but also the larger questions of fading traditional values in the face of increasing materialism and cynicism.</p>        <h5>&nbsp;</h5>        <h5 id="head"><strong>Plot&nbsp;and Major Characters</strong></h5>        <p>Fitzgerald frames his plot as a story within a story, as the narrator, Nick Carraway, relates his version of Jay Gatsbys life. Nick, seeking freedom from his constricted Midwestern existence, takes a job in New York City and rents a bungalow in West Egg, Long Island, next door to the lavish mansion of the mysterious Jay Gatsby. Nicks wealthy cousin, Daisy Buchanan, and her husband Tom, invite Nick to dinner with the attractive but flighty Jordan Baker at their luxurious home on the neighboring island of East Egg. Unsettled by the Buchanans emingly purposeless lives, Nick returns home and notices his neighbor Gatsby staring longingly at a green light across the bay coming from the Buchanans property. Tom later persuades Nick to accompany him to a place he calls the Valley of Ashes and introduces him to his blowsy mistress, Myrtle Wilson. Tom, Myrtle, and Nick end up at an apartment in New York, where a wild party ensues, and in a violent outburst, Tom strikes Myrtle and breaks her nose.</p>        <p>Later in the month, Gatsby sends Nick an invitation to come to a sumptuous party at his estate, where Nick meets his neighbor for the first time. This is the first of many parties Nick attends at the Gatsby mansion in the company of many of the rich and famous. When Gatsby later takes Nick to New York for lunch, he regales him with tales of his war medals and his Oxford education. The other guest at lunch is the notorious gangster Meyer Wolfsheim, who reportedly fixed the World Series in 1918. Nick, befuddled by Gatsbys questionable associations, is also taken aback when Jordan asks him on Gatsbys behalf to invite Daisy to lunch at Nicks bungalow. He does so even though he now knows that Daisy and Gatsby were in love prior to her marriage to Tom. The two ill-fated lovers meet, and Gatsby takes Daisy to his mansion and invites her to his next party. Daisy agrees, but when she disapproves of some of his guests, Gatsby stops entertaining altogether. He eventually tells Nick of his truly humble Midwest origins, noting that his name is really Gatz, that he did not graduate from Oxford, and that he has made his fortune in bootlegging and other nefarious ventures.</p>        <p>One&nbsp;day Gatsby, the Buchanans, Jordan, and Nick drive to New York. On the way, they stop at the garage of George Wilson, husband of Myrtle, who tries to get money from Tom and announces that he and Myrtle are leaving town. At a hotel in New York, Tom accuses Gatsby of trying to steal his wife, and a fierce argument ensues. Daisy heads home with Gatsby, and shortly thereafter Tom and Jordan stop at Wilsons garage to find that Myrtle has been killed by a hit-and-run driver of a yellow car. Tom blames the death on Gatsby though the real driver at the time was Daisy, whom Gatsby seeks to protect. George Wilson, thinking Gatsby was the driver, goes to Gatsbys estate, shoots him, and then kills himself. Only Gatsbys father, who thinks his son was a great man, attends his funeral. Nick later learns that Tom had a part in Gatsbys death, having convinced Wilson that Myrtle and Gatsby were lovers. Disillusioned with the Buchanans and their ilk, Nick decides to return to the Midwest.</p>        <h5>&nbsp;</h5>        <h5><strong>Critical&nbsp;Reception</strong></h5>        <p>Early reviews of&nbsp;<em>Gatsby</em>&nbsp;were mixed, and relatively few copies actually had sold before Fitzgeralds death in 1940. Many critics, most notably Ernest Hemingway, were put off by the fact that Fitzgerald had been known as a writer of stories for popular magazines like&nbsp;<em>The Saturday Evening Post.</em>&nbsp;It was not until a revival of Fitzgeralds works in the 1950s that the novel began to attract serious criticism. For the five ensuing decades,&nbsp;<em>Gatsby</em>&nbsp;has continued to attract critical attention and reappraisal. Critics have praised Fitzgeralds tightly woven narrative, and many have focused on the position of the narrator, Nick Carraway, and the subjective limitations of his observations of Gatsbys saga. Although&nbsp;<em>Gatsby</em>&nbsp;was for many years called "a novel of the Jazz Age" (a term which Fitzgerald coined), critics have agreed that it has a much more universal meaning, not the least of which is a trenchant critique of materialist American society much like T. S. Eliots&nbsp;<em>The Waste Land.</em></p>        <p>The appea<b>rance of</b> at least four biographies in the 1990s and early 2000s is an indication that interest in Fitzgeralds novels remains unabated. Earlier critics of&nbsp;<em>Gatsby</em>&nbsp;emphasized biographical and cultural influences on the novel, and formalist approaches dealt with the novels structure, point of view, symbols, use of language, and the like. By the 1980s through the early 2000s, a variety of approaches, both heavily theoretical and non-theoretical, have been evident in critics commentaries. While many have continued to explore biographical influences or comparisons with other authors, or to use New Critical analyses, others have increasingly employed such techniques as deconstruction, feminist criticism, and discourse analysis to uncover hidden meanings in the text.</p>        <p style="text-align:center">&nbsp;</p>  </div>';

